function atobCustom(input) {
  const chars='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=';
  let str=String(input).replace(/=+$/,'');
  if(str.length%4===1) throw new Error('atob failed');
  let output='';
  for(let i=0,t=0,r,c;i<str.length;i++){c=chars.indexOf(str.charAt(i));~c&&(r=t%4?r*64+c:c,t++%4?output+=String.fromCharCode(255&r>>(-2*t&6)):0);} 
  return output;
}

function decodeUtf8(s){
  const bytes=[];
  for(let i=0;i<s.length;i++) bytes.push(s.charCodeAt(i)&255);
  let result='';
  let i=0;
  while(i<bytes.length){
    const b=bytes[i];
    if(b<128){result+=String.fromCharCode(b);i++;}
    else if((b&224)===192&&i+1<bytes.length){result+=String.fromCharCode(((b&31)<<6)|(bytes[i+1]&63));i+=2;}
    else if((b&240)===224&&i+2<bytes.length){result+=String.fromCharCode(((b&15)<<12)|((bytes[i+1]&63)<<6)|(bytes[i+2]&63));i+=3;}
    else if((b&248)===240&&i+3<bytes.length){const code=((b&7)<<18)|((bytes[i+1]&63)<<12)|((bytes[i+2]&63)<<6)|(bytes[i+3]&63);
      if(code>65535){const high=(code-65536>>10)+55296;const low=(code-65536&1023)+56320;result+=String.fromCharCode(high,low);} else result+=String.fromCharCode(code);
      i+=4;
    } else i++;
  }
  return result;
}

function step1(s){return s.substring(15,33)+s.substring(50);}
